// 封装具体的接口请求方法
// 注意：每个方法只负责请求一个url地址
import request from '@/utils/request.js'
// 导出接口，为了在逻辑页面引入后调用
export const registerAPI = () => {
  return request({
    url: '/api/reg',
    method: 'POST',
    data: {
      username: 'shangtingting123',
      password: '123123',
      repassword: '123123'
    }
  })
}
